import React from 'react';
import './ContactCard.scss';
import contactAvatar from './contact.png';

const ContactCard = (props: any) => {
  return (
    <div className="contact-card">
        <div className="card-header">
            <div className="contact-name">{props.contact.name}</div>
            <img src={contactAvatar} className="contact-image" alt="contact" />
        </div>
        <div className="card-content">
            <div className="content-row">
                <label>email</label> {props.contact.email}
            </div>
        </div>
    </div>
  );
}

export default ContactCard;
